import React from "react";
import NotificationsActiveIcon from '@material-ui/icons/NotificationsActive';

const Notice = () => {

    return(
        <>
<section>
            <div  id="notice">
                <div className="notice bg-dark">
            <a href="https://www.bitsindri.ac.in" className=" text-white text-decoration-none" > 
            <p className="animation"> for latest announcement and notices, click here... </p>
            <NotificationsActiveIcon className="animation" /></a>
            </div>
            </div>
            <br/><br/>
         </section>

        </>
    );
};

export default Notice;
